			// Fonction pour obtenir la localisation de l'utilisateur
			function obtenirLocalisation() {
			  if (navigator.geolocation) {
				navigator.geolocation.getCurrentPosition(function(position) {
				  var lat = position.coords.latitude;
				  var lng = position.coords.longitude;

				  // Ajouter un marqueur à la position actuelle de l'utilisateur
				  var marker = L.marker([lat, lng]).addTo(map_29c8276ce9d70702d72a6dfc6ca46c71);

				  // Événement de clic sur la carte
				  map_29c8276ce9d70702d72a6dfc6ca46c71.on('click', function(e) {
					console.log(e);

					// Ajouter un second marqueur à l'emplacement cliqué
					var secondMarker = L.marker([e.latlng.lat, e.latlng.lng]).addTo(map_29c8276ce9d70702d72a6dfc6ca46c71);

					// Ajouter le contrôle de routage avec des points de passage
					L.Routing.control({
					  waypoints: [
						L.latLng(lat, lng), // Point de départ (position actuelle)
						L.latLng(e.latlng.lat, e.latlng.lng) // Point d'arrivée
					  ]
					}).addTo(map_29c8276ce9d70702d72a6dfc6ca46c71);
				  });

				}, function() {
				  alert("La géolocalisation a échoué ou n'est pas disponible.");
				});
			  } else {
				alert("La géolocalisation n'est pas supportée par ce navigateur.");
			  }
			}

			// Appeler la fonction pour obtenir la localisation
			obtenirLocalisation();

    let fields = ["Matricule", "X", "Y", "He", "Region", "Localites", "Description"];
    let aliases = ["Matricule", "X", "Y", "He", "Region", "Localites", "Description"];
    let table = '<table>' +
        String(

        `<tr>
            <th>${aliases[i].toLocaleString()}</th>
            
            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
